import useHttp  from "../../hooks/use-http"
const DiaryEntery = () => {
    const {isLoading: loading, isError: error, sendRequest: getData} = useHttp()
    const transformData = (data) => {
        console.log(data)
    }
    useEffect(() => {
        getData({url: "http://localhost:8080/api/entery/create/fetch"}, transformData)

    }, [])
    return (
        <Fragment>
        <h2>Latest Enteries</h2>
        <section className="entery-grid">

        </section>
        </Fragment>

    )
}
export default DiaryEntery
